import * as React from "react";
import {
  AppBar,
  Box,
  Toolbar,
  Typography,
  Container,
  Link,
} from "@mui/material";
import { makeStyles } from "@mui/styles";

const useStyles = makeStyles({
  root: {},
  linksContainer: {
    flexGrow: 1,
    display: "flex",
  },
  linkContainer: {
    margin: "0 8px",
  },
  link: {
    lineHeight: "1.5rem",
    textDecoration: "none",
    color: "white",
    display: "block",
  },
});

const Header = () => {
  const classes = useStyles();
  const pages = ["Home", "About", "Projects", "Resume"];
  const pagesMap = {
    Home: "",
    About: "about",
    Projects: "projects",
    Resume: "resume",
  };

  return (
    <AppBar
      position="static"
      color="transparent"
      elevation={0}
      className={classes.root}
    >
      <Container maxWidth="xl">
        <Toolbar disableGutters>
          <Box className={classes.linksContainer}>
            {pages.map((page) => (
              <Box key={page} className={classes.linkContainer}>
                <Link
                  href={pagesMap[page]}
                  underline="none"
                  variant="overline"
                  className={classes.link}
                >
                  {page}
                </Link>
              </Box>
            ))}
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
  );
};
export default Header;
